import React from 'react';
import { NativeBaseProvider } from 'native-base';
import AppNavigator from './AppNavigator';

export default function App() {
  return (
    <NativeBaseProvider>
       <Center flex={1} bg="#fff">
      <AppNavigator />
      </Center>
    </NativeBaseProvider>
  );
}
